    text-align: center;
    animation-name: fadeIn;
    animation-duration: 6s;
    animation-iteration-count: 1;
    animation-fill-mode: both;
}
@keyframes fadeIn {
    0% {
        opacity: 0;
    }
    100% {
        opacity: 1;
    }

}


